    false,nt"url": null,nt"notes": "This narrative report for Sabine NWR outlines
    Refuge accomplishments from September through December of 1943. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, and
    fish- is also covered. The Refuge development and maintenance section discusses
    physical developments. Resource management is outlined; topics include grazing and
    fur harvesting. The public relations section of the report describes Refuge visitors,
    fishing, and violations. N-R forms and photographs are attached.",nt"owner_org":
